catvm.memory.tool_funcs.json_to_string = function json_to_string(dict_obj) {
    var cookie_str = "";
    for (let key in dict_obj) {
        cookie_str += `${key}=${dict_obj[key]}; `
    }
    // 正则去除末尾 '; '
    return cookie_str.replace(/; $/g, "")
}
